!(function (e) {
  "use strict";
  e(window).on("load", function () {
    e("#preloader").addClass("loaded");
  }),
    e(".navbar-nav a").on("click", function (t) {
      var a = e(this);
      e("html, body")
        .stop()
        .animate(
          { scrollTop: e(a.attr("href")).offset().top - 0 },
          1500,
          "easeInOutExpo"
        ),
        e(".navbar").hasClass("active") &&
          (e(".navbar").removeClass("active"), e(".ham").removeClass("active")),
        t.preventDefault();
    }),
    e(".navbar-toggler").on("click", function () {
      e("body").toggleClass("aside-open"),
        e(".ham").toggleClass("active"),
        e("body, html").toggleClass("overflow-hidden");
    }),
    e("#navbarCollapse").scrollspy({ offset: 20 });
  new Swiper(".swiper-testimony", {
    spaceBetween: 30,
    navigation: {
      nextEl: ".swiper-button-next",
      prevEl: ".swiper-button-prev",
    },
  });
  var t = new WOW({
    boxClass: "wow",
    animateClass: "animated",
    offset: 0,
    mobile: !0,
    live: !0,
    callback: function (e) {},
    scrollContainer: null,
    resetAnimation: !0,
  });
  t.init();
  var a = e(".list-items-container");
  if (
    (e("#filter li").on("click", function (t) {
      t.preventDefault(),
        e("#filter li").removeClass("active"),
        e(this).addClass("active");
      e(this).attr("data-group");
      var l = e(this).attr("data-group");
      a.shuffle("shuffle", l);
    }),
    e("#scene").length)
  ) {
    var l = document.getElementById("scene");
    new Parallax(l);
  }
  e(".toggle-theme-panel").on("click", function (t) {
    t.preventDefault(), e(".settings_panel").toggleClass("active");
  }),
    e(".colors-switch a").on("click", function (t) {
      e("#preloader").removeClass("loaded"),
        setTimeout(function () {
          e("#preloader").addClass("loaded");
        }, 1500),
        t.preventDefault();
      var a = e(this).attr("title");
      console.log(a),
        e("head").append(
          '<link rel="stylesheet" href="assets/css/' + a + '.css">'
        );
    }),
    e("#autoplay").textition({
      speed: 1.5,
      animation: "ease-out",
      map: { x: 200, y: 100, z: 0 },
      autoplay: !0,
      interval: 3,
    });
})(window.jQuery);

